import React from 'react';

const Transaccion = () => {


    return (
        <section className='transaccion'>
            <h2>Transacciones</h2>
            <ul>
                <li><strong>Retiro de agente:</strong> S/. 74125</li>
                <li><strong>Pago por yape:</strong> S/. 325478</li>
                <li><strong>Pago de luz:</strong> S/. 325456</li>
            </ul>
        </section>
    );
};


export default (Transaccion);
